member.remarks:
You can select the ALC loop bandwidth or
let the signal generator do it for you based on the current signal setup.(Auto)
The ESG does not support the 100kHz ALC loop bandwidth.

member.example:


             The following example shows you how to use API to automatically generate 
             multiple legacy WLAN waveforms and download them into multiple signal generators using LAN. 
             This example generates two different waveforms (one for 802.11a,another for 802.11g) 
             and saves them with different file names (WLAN_1, WLAN_2), 
             then downloads them into two signal generators separately. 
             You can copy and modify this example to use it in an automatic test environment based on your requirements.

Before running your API program, copy agdsp_32.dll from the application installation path to the API running path.

A C# console application example.



             using System;
             using Agilent.SignalStudio.N7617;

             public class MultipleLegacyWaveformApiSample
            	{
            		public MultipleLegacyWaveformApiSample()
            		{
            		}

            		static void Main()
            		{
            			LegacyAPI api1 = new LegacyAPI();
            			api1.WaveformSetup.Carrier[0].Format = Format.Std11g;
            			api1.WaveformSetup.Carrier[0].DataRate = DataRate11g.OFDM_48;
            			api1.WaveformSetup.WaveformName = "WLAN_1";
            			api1.Generate();
            			api1.ConnectInstrument("ipAddress1");
            			api1.Download();

            			LegacyAPI api2 = new LegacyAPI();
            			api2.WaveformSetup.Carrier[0].Format = Format.Std11a;
            			api2.WaveformSetup.Carrier[0].DataRate = DataRate11a.OFDM_54;
            			api2.WaveformSetup.Carrier[0].NumberOfFrames = 3;
            			api2.WaveformSetup.WaveformName = "WLAN_2";
            			api2.Generate();
            			api2.ConnectInstrument("ipAddress1");
            			api2.Download();

            			api1.ConnectInstrument("ipAddress2");
            			api1.Download();

            			api2.ConnectInstrument("ipAddress2");
            			api2.Download();
            		}
            	}

The code segment not keeping WaveformSetup.

string fileName = "c:\\LegacySettings.xml";
LegacyAPI api = new LegacyAPI();
api.WaveformSetup.IQGainBalance = 1;
api.WaveformSetup.MirrorSpectrum = true;
api.SaveSettingsFile(fileName);
api.New();
api.OpenSettingsFile(filename);
api.WaveformSetup.WaveformName = "WLAN11G";
api.Generate();

The code segment keeping WaveformSetup in a local variable.

string fileName = "c:\\LegacySettings.xml";
LegacyAPI api = new LegacyAPI();
WaveformLegacy waveformSetup = api.WaveformSetup; // api.WaveformSetup is assigned to a local variable.
waveformSetup.IQGainBalance = 1;
waveformSetup.MirrorSpectrum = true;
api.SaveSettingsFile(fileName);
api.New();
api.OpenSettingsFile(filename);
waveformSetup = api.WaveformSetup; // waveformSetup is updated. 
waveformSetup.WaveformName = "WLAN11G";
api.Generate();

The code segment keeping WaveformSetup in a local variable. An exception will be thrown in this example.

string fileName = "c:\\LegacySettings.xml";
LegacyAPI api = new LegacyAPI();
WaveformLegacy waveformSetup = api.WaveformSetup; // api.WaveformSetup is assigned to a local variable.
waveformSetup.IQGainBalance = 1;
waveformSetup.MirrorSpectrum = true;
api.SaveSettingsFile(fileName);
api.New();
api.OpenSettingsFile(filename);
// waveformSetup is NOT updated. An exception will be throw in next line.
waveformSetup.WaveformName = "WLAN11G";
api.Generate();

