member.example:
             The following examples show how to use API to generate a WLAN waveform and download it into Signal Generator using LAN.
             Before running your API program, copy agdsp_32.dll from the application installation path to the API running path.

A C# console application example.



             using System;
             using Agilent.SignalStudio.N7617;

            	public class LegacyApiSample
            	{
            		[STAThread]
            		static public void Main()
            		{
            			LegacyAPI api = new LegacyAPI();
            			api.WaveformSetup.Carrier[0].Format = Format.Std11g;
            			api.WaveformSetup.Carrier[0].DataRate = DataRate11g.OFDM_48;
            			api.WaveformSetup.WaveformName = "WLAN11G";
            			api.Generate();
            			api.ConnectInstrument("TCPIP0::SignalGeneratorIPAddress::INSTR");
            			api.Download();
            		}
            	}


A VB console application example.



             Imports System
             Imports Agilent.SignalStudio.N7617

             Public Class LegacyApiSample
            		Shared Sub Main()
            			Dim api As New LegacyAPI
            			api.WaveformSetup.Carrier.Item(0).Format = Format.Std11g
            			api.WaveformSetup.Carrier.Item(0).DataRate = DataRate11g.OFDM_48
            			api.WaveformSetup.WaveformName = "WLAN11G"
            			api.Generate()
            			api.ConnectInstrument("TCPIP0::SignalGeneratorIPAddress::INSTR")
            			api.Download()
            		End Sub
             End Class



A Managed C++ console application example.

Please copy all the dll files from the application installation path to the API running path.

             using namespace System;
             using namespace Agilent::SignalStudio::N7617;

            	int main()
            	{
            		LegacyAPI __gc* api = __gc new LegacyAPI();
            		api->WaveformSetup->Carrier->get_Item(0)->Format = Format::Std11g;
            		api->WaveformSetup->Carrier->get_Item(0)->DataRate = DataRate11g::OFDM_48;
            		api->WaveformSetup->WaveformName = S"WLAN11G";
            		api->Generate();
            		api->ConnectInstrument(S"TCPIP0::SignalGeneratorIPAddress::INSTR");
            		api->Download();
            		return 0;
            	}

remarks.code:
