member.example:
The following examples show how to use API to generate two WLAN MIMO waveform and download them into two Signal Generators using LAN.
             Before running your API program, copy agdsp_32.dll from the application installation path to the API running path.	

A C# console application example.



            	using System;
            	using Agilent.SignalStudio.N7617;

            	public class MimoApiSample
            	{
            		static public void Main()
            		{
            			MimoAPI api = new MimoAPI();
            			api.SetMimoFunction(MimoFunction.MIMO_Mx2_2SG);
            			api.WaveformSetup.Config.SpatialMappingScheme = SpatialMappingScheme.SpatialExpansion;
            			api.WaveformSetup.Config.McsIndex.Index = 15;
            			api.Generate();
            			api.ConnectInstrument("ipAddress1", "ipAddress2");
            			api.Download();
            		}
            	}


A VB console application example.



            	Imports System
            	Imports Agilent.SignalStudio.N7617

            	Public Class MimoApiSample
            	Public Shared Sub Main()
            	Dim api As New MimoAPI
            	api.SetMimoFunction(MimoFunction.MIMO_Mx2_2SG)
            	api.WaveformSetup.Config.SpatialMappingScheme = SpatialMappingScheme.SpatialExpansion
            	api.WaveformSetup.Config.McsIndex.Index = 15
            	api.Generate()
            	api.ConnectInstrument(New String() {"ipAddress1", "ipAddress2"})
            	api.Download()
            	End Sub
            	End Class


A Managed C++ console application example.

Please copy all the dll files from the application installation path to the API running path.

            	using namespace System;
            	using namespace Agilent::SignalStudio::N7617;
            	using namespace Agilent::SignalStudio;
            	int main()
            	{
            		MimoAPI __gc* api = __gc new MimoAPI();
            		api->SetMimoFunction(MimoFunction::MIMO_Mx2_2SG);
            		api->WaveformSetup->Config->SpatialMappingScheme = SpatialMappingScheme::SpatialExpansion;
            		api->WaveformSetup->Config->McsIndex->Index = 15;      
            		pi->Generate();
            		String __gc* addr __gc[] = {S"ipAddress1", S"ipAddress2"};
            		api->ConnectInstrument(addr);
            		api->Download();
            		return 0;
            	}

remarks.code:
LegacyApi api = new LegacyApi();
string address1 = "GPIB::19::INSTR";
string address2 = "TCPIP0::146.208.220.120::INSTR";
api.ConnectInstrument(address1, address2);

