member.example:
The following examples show how to use API to generate two WLAN11ax MIMO waveform and download them into two Signal Generators using LAN.

A C# console application example.



            	using System;
            	using Agilent.SignalStudio.N7617;

            	public class Wlan11axApiSample
            	{
            		static public void Main()
            		{
            			Wlan11axAPI api = new Wlan11axAPI();
            			api.SetWlan11axFunction(Mimo11axFunction.MIMO_Mx2_2SG);
            			api.WaveformSetup.GenerationMode =  Agilent.SignalStudio.Wlan11ax.GenerationMode.PPDU_MU_Format;
            			api.WaveformSetup.OfdmaCarrierConfig.CompressionSigB = true;
            			api.WaveformSetup.OfdmaCarrierConfig.UserNumber = 2;   //Set the number of  MU-MIMO users when SIGB compression mode is enabled
            			api.WaveformSetup.OfdmaCarrierConfig.RUSetups[0].UserSetups[0].McsIndex = 6;
            			api.WaveformSetup.OfdmaCarrierConfig.RUSetups[0].UserSetups[1].McsIndex = 4;
            			api.Generate();
            			api.ConnectInstrument("ipAddress1", "ipAddress2");
            			api.Download();
            		}
            	}


