member.example:
A C# console application to modify the elements of the spatial mapping matrix and save all the settings to a file. 

using System;
using Agilent.SignalStudio.N7617;
using Agilent.SignalStudio;
public class MimoApiSample
{
	static public void Main()
	{
		MimoAPI api = new MimoAPI();
		api.SetMimoFunction(MimoFunction.MIMO_Mx2_2SG);
		api.WaveformSetup.Config.McsIndex.Index = 15;
		api.WaveformSetup.Config.SpatialMappingScheme = SpatialMappingScheme.UserDefined;
		api.WaveformSetup.Config.SpatialMappingMatrix.Data[0, 0] = new Complex(1,0);
		api.WaveformSetup.Config.SpatialMappingMatrix.Data[0, 1] = new Complex(0.5,0.5);
		api.WaveformSetup.Config.SpatialMappingMatrix.Data[1, 0] = new Complex(0,1);
		api.WaveformSetup.Config.SpatialMappingMatrix.Data[1, 1] = new Complex(0.7,0.7);
		api.SaveSettingsFile("c:\\MimoSettings.xml");
	}
}

             The following example shows how to use API to setup a  object.

A C# console application example.



             using System;
             using Agilent.SignalStudio.N7617;

            	public class LegacyApiSample
            	{
            		[STAThread]
            		static public void Main()
            		{
            			LegacyAPI api = new LegacyAPI();
            			api.WaveformSetup.Carrier[0].Filter.FilterType = FilterType.Gaussian;
            			api.WaveformSetup.Carrier[0].Filter.BT = 0.5;
            			api.WaveformSetup.Carrier[0].Filter.LengthBySymbol = 8;
            		}
            	}
